  `refered_from` varchar(100) DEFAULT NULL,
  `townstar` varchar(20) NOT NULL DEFAULT 'pending',
  `played_by` varchar(100) DEFAULT NULL,
  `eth_address` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  PRIMARY KEY (`email`),
  KEY `creator` (`creator`),
  KEY `refered_from` (`refered_from`),
  KEY `played_by` (`played_by`),
  CONSTRAINT `emails_ibfk_2` FOREIGN KEY (`refered_from`) REFERENCES `player` (`player`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `emails_ibfk_3` FOREIGN KEY (`played_by`) REFERENCES `user` (`username`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
